(()=>{window.timeDiffText=t=>{let n=Math.floor(t/864e5),r=Math.floor(t%(1e3*60*60*24)/(1e3*60*60)),e=Math.floor(t%(1e3*60*60)/(1e3*60)),o=Math.floor(t%(1e3*60)/1e3);return[n.toString().padStart(2,"0"),r.toString().padStart(2,"0"),e.toString().padStart(2,"0"),o.toString().padStart(2,"0")]};window.countdownToDate=(t,n,r="",e=null)=>{let o=document.getElementById(n);if(!o){console.error(`Timer element ${n} not found`);return}function a(){let c=t-new Date;if(c<0){clearInterval(e),o.innerHTML=`<div class='countdown-end'>${r}</div>`;return}let i=timeDiffText(c);o.querySelectorAll(".countdown-number").forEach((d,s)=>{d.textContent=i[s]})}a(),e=setInterval(a,1e3)};})();
